@kevinreiss Some information I found that might be useful: 

- Do we have both the `from_timezone` and `to_timezone` set in the RSS importer config? We may only have the "from" and it's converting to Drupal's default "to." Maybe try changing them both to say Eastern if we don't already have that (see this [documentation page](https://api.drupal.org/api/drupal/core%21modules%21migrate%21src%21Plugin%21migrate%21process%21FormatDate.php/class/FormatDate)). 
- Comments 8-14 on [this forum](https://www.drupal.org/project/feeds/issues/3157965) could be helpful (setting the site's default timezone may be an ongoing bug?).
